import React, {FC} from 'react';
import {useAppDispatch} from "../../hooks/redux";
import {Button, Modal} from "react-bootstrap";

interface IEditOrderModal {
    show: boolean,
    closeHandler: (statusCode?: number) => void,
    id: number,
}
const EditOrderModal:FC<IEditOrderModal> = ({id, closeHandler, show}) => {
    const dispatch = useAppDispatch()
    if (!show) return null
    return (
        <Modal show={show} onHide={closeHandler}>
            <Modal.Header closeButton>
                <Modal.Title>Edit order</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <form action="">
                    <div className="mb-3">
                        <label htmlFor="status" className="form-label">Status</label>
                        <input type="email" className="form-control" id="status"/>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="status" className="form-label">IsConfirmed</label>
                        <input type="email" className="form-control" id="status"/>
                    </div>
                </form>
            </Modal.Body>
            <Modal.Footer>
                <Button onClick={() => closeHandler()} variant="secondary">Close</Button>
                <Button variant="danger">Delete</Button>
            </Modal.Footer>
        </Modal>
    );
};

export default EditOrderModal;
